import React, { useEffect } from "react";
import axios from "axios";
// https://api.themoviedb.org/3/movie/550?api_key=628e09f41a4b7a1f3b3c15de74faa337
// https://api.themoviedb.org/3/search/movie?api_key=628e09f41a4b7a1f3b3c15de74faa337&query=''
const MovieSearchApp = () => {
  useEffect(() => {
    async function fetchData() {
      const result = await axios.get(
        `https://api.themoviedb.org/3/search/movie?api_key=628e09f41a4b7a1f3b3c15de74faa337&query=''`
      );
      console.log(result.data);
    }
    fetchData();
  }, []);
  return (
    <div className="p-10">
      <div className="w-full max-w-[500px] mx-auto"></div>
    </div>
  );
};

export default MovieSearchApp;
